import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

const Header = (props) => {
  return (
    <header>
      <h1 className="title">Simple Grocery List</h1>
      <span className="item-total">Items: </span>
    </header>
  )
}
const Item = (props) => {
  return(
    <div className="item">
      <span className="item-name">
        {props.name}
      </span>
      <Counter />
    </div>
  )
}
class App extends Component {
  render() {
    return (
      <div className="container">
        <Header />
      </div>
    );
  }
}

export default App;
